// Get cubes DOM element
  const cubesElement = document.querySelector(".cubes");
  const sceneElement = document.querySelector(".scene");
  const astronautOne = document.querySelector("#astronautOne");
  const astronautTwo = document.querySelector("#astronautTwo");
  const astronautOneSvg = document.querySelector("#eqGpixCEy2m1");
  const astronautTwoSvg = document.querySelector("#eqK497tWLZI1");
  const svgOnePlayer = astronautOneSvg ? astronautOneSvg.svgatorPlayer : {};
  const svgTwoPlayer = astronautTwoSvg ? astronautTwoSvg.svgatorPlayer : {};

  // Zdog settings
  const sceneSize = 96;
  const TAU = Zdog.TAU;
  const ROOT3 = Math.sqrt(3);
  const ROOT5 = Math.sqrt(5);
  const PHI = (1 + ROOT5) / 2;
  let isSpinning = true;
  const viewRotation = new Zdog.Vector();
  let displaySize;

  // Zdog colors
  const red = "#2de2e6";
  const orange = "#9cb8d2";
  const yellow = "#fefefc";
  const green = "#4c7ca4";
  const blue = "#9cb8d2";
  const purple = "#b073a3";

  let hasBeenScared = false;

  // Initialize Zdog scene
  const cubes = new Zdog.Illustration({
    element: cubesElement,
    scale: 8,
    resize: "fullscreen",
    dragRotate: true,
    // Stop rotation when dragging starts
    onDragStart: function () {
      isSpinning = false;
      // Reduce blur on .cubes
      cubesElement.style.filter = "blur(0px)";
      // Scare astronauts
      if (!hasBeenScared) {
        svgOnePlayer.play();
      }
      if (!hasBeenScared) {
        svgTwoPlayer.play();
      }
      astronautOne.classList.add("scared");
      astronautTwo.classList.add("scared");
      hasBeenScared = true;
    },
    //
    onResize: function (width, height) {
      displaySize = Math.min(width, height);
      this.zoom = Math.floor(displaySize / sceneSize);
      isSpinning = true;
    }
  });

  // Solids array
  const solids = [];

  // Create a cube
  const cube = new Zdog.Box({
    addTo: cubes,
    width: 2,
    height: 2,
    depth: 2,
    translate: { x: 0, y: 0 },
    rotate: { z: 0.3 },
    topFace: red,
    frontFace: orange,
    leftFace: yellow,
    rightFace: green,
    rearFace: blue,
    bottomFace: purple,
    stroke: false
  });

  // Add to solids array
  solids.push(cube);

  // Animate function
  function animate() {
    // Rotate
    if (isSpinning) {
      cubes.rotate.y += 0.01;
    }
    cubes.updateRenderGraph();
    requestAnimationFrame(animate);
  }

  // Animate
  animate();

